subSubSection.paragraph:
Caecum crebricinctum

— 
Tryon, 1886: 218
, pl. 67, fig. 71; Abbott, 1974: 91, fig. 873; 
McLean, 1978: 30
, fig. 14.3; 
Hertz,

1979a: 2; 
Draper, 1982: 29
, figs. 1–3.; 
Draper, 1985: 3
, figs. 1, 3, 7–8; 
McLean & Gosliner, 1996: 49
; 
Raines, 2019: 99
, figs. 2A–B.

Description.
Protoconch paucispiral (about 1.7 whorls), planispiral, smooth (
Fig. 55A
), transition to teleoconch I marked by apertural varix (
Fig. 55A
). Teleoconch I short, sculptured with weak irregular reticular sculpture (
Fig. 55B
), transition to teleoconch II marked by change in sculpture (
Fig. 55A
). Teleoconch II about 3 times length of teleoconch I, sculptured with low axial annuli, crossed by longitudinal striae (
Fig. 55C
), transition to teleoconch III marked by weak axial constriction (
Figs. 55A, D
). Teleoconch III with similar characters as previous stage, but with somewhat stronger axial annuli (
Fig. 55E
), transition to teleoconch IV marked by slight axial narrowing (
Fig. 55D
). Teleoconch IV sculptured with flattened axial rings crossed by longitudinal striae (
Fig. 55F
), transition to teleoconch V marked by axial constriction (
Fig. 55H
). Teleoconch V (last growth stage) large for genus [Tol 
4.79–6.12 mm
], tubular, rather thick, stout, somewhat arched, [Larc: 
1.59–2.20 mm
; Arc: 
0.30–0.45 mm
], subcylindrical with slight increase in diameter from posterior to aperture, cream white, solid, striped, or mottled with tan to reddish brown (
Figs. 54
A–C). Sculpture comprising of numerous close–set flattened axial rings and short, longitudinal striae on shoulder of axial rings and in the interspaces (
Fig. 55F
). Axial interspaces shallow, narrower than ribs (
Figs. 55D, F
). Posterior [Dpe: 
0.30–0.49 mm
] with rather thick edge, squared shoulder (
Fig. 54D
). Septum mucronate, slightly raised (
Fig. 54D
). Mucro with rounded point, pronounced, positioned on dorsal margin (
Figs. 54
D–E). Aperture [Da: 
0.45–0.75 mm
] thick, slightly constricted. No varix. Lip smooth, with deflected peristome (
Fig. 54D
). Periostracum not observed. Operculum thin, dark brown; exterior surface with 9–11 concentric rings (
Figs. 54
F–G). Conceptual reconstruction of growth stages shown in 
Fig. 56A
.
